import React from 'react';

export function Circle(props) {
    return (
        <div className="circle" onMouseUp={props.onMouseUp} onTouchEnd="process_touch(ev)" style={{ backgroundColor: props.color }}>{props.value}</div>
    );

    function process_touch(ev) {
        ev.preventDefault();
        props.onTouchEnd;
    }
}
